import Card1 from './imgs/image1.png'
import Rating1 from './imgs/rating1.png'

function cards() {
    return (
        <div className='mx-3 my-5 '>
            <div className=''>
                <img src={Card1} className='card-image shadow-lg'></img>
                <img src={Rating1} className='rating-image' ></img>
            </div>
        </div>
    )
}

export default cards;
